import { useState } from "react";
import { BrowserRouter as Router,Routes,Route,Link } from "react-router-dom"


const Login=()=>{
const [name,nameupdate]=useState("");
const [pswd,pswdupdate]=useState("");

const ProceedLogin=(e)=>{
    e.preventDefault();
}
    return(
      <div>
          
          <div className="column">
            <div className="offset-lg-3 col-lg-3">
                <form onSubmit={ProceedLogin} className="container">
                    <div className="card-header">
                    <h1>Login</h1>
                    </div>
                     <div className="card-body">
                        <div className="form-group">
                            <label>Fullname</label>
                          <input className="form-control"></input>
                        </div>
                        <div className="form-group">
                            <label>Password</label>
                          <input className="form-control"></input>
                        </div>
                     </div>
                     <div className="card-footer">
                     <Link type='submit' style={{marginRight:"2%",marginLeft:"2%"}}  className="btn btn-primary" to="/EmpTable" >Login</Link>
                     <Link type='submit' style={{marginRight:"2%",marginLeft:"2%"}}  className="btn btn-primary" to="/SignUp" >Register</Link>
                     </div>
                </form>
            </div>
          </div>
      </div>
    );
}
export default Login;
